import React from 'react';
import { Box, Typography } from '@mui/material';
import RegistrationForm from '../components/RegistrationForm';

function Register() {
  return (
    <Box className="container">
      <Typography variant="h2" gutterBottom>
        Register Your Case
      </Typography>
      <RegistrationForm />
    </Box>
  );
}

export default Register;
